    elementStyle = () => {
        return {
            backgroundColor: (this.props.dataSet.name === this.props.picked.name) 
                ? '#add8e6' : '#f4f4f4',
            padding: '10px',
            margin: '20px',
            borderBottom: '2px #ccc dotted',
            cursor: 'pointer'
        }
    }

    pickedDataSet = () => {
        this.props.pickedDataSet(this.props.dataSet);
    }

    render() {
        return (
            // <div style={this.elementStyle()} onClick={this.pickedDataSet}>
